pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

import "@klaytn/contracts/token/KIP17/KIP17Token.sol";
import "@klaytn/contracts/drafts/Counters.sol";

contract MZNFT is KIP17Full {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

     struct Item {
        uint256 id;
        string name;
        address creator;
        string img_uri;//metadata url
      }

    mapping(uint256 => Item) public Items; //id => Item
    constructor() public KIP17Full("MZNFT", "MZNFT") {}

   function mint(address creator, string memory uri, string memory contentName)
        public
        returns (uint256)
    {
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(creator, newItemId);

         Items[newItemId] = Item({
                  id: newItemId,
                  name: contentName,
                  creator: creator,
                  img_uri: uri
                });

        return newItemId;
    }

   function tokenURI(uint256 tokenId)
        public
        view
        returns(string memory)
    {
        require(_exists(tokenId), "KIP-17 URIStorage: URI query for nonexistent token");
        return Items[tokenId].img_uri;
    }

   function getItem(uint256 tokenId)
        public
        view
        returns (Item memory)
    {
       require(_exists(tokenId), "KIP-17 URIStorage: URI query for nonexistent token");
       return Items[tokenId];
    }


}
